import React from 'react'
import propTypes from 'prop-types'
import { View } from 'react-native';
import { CardViewWithImage } from 'react-native-simple-card-view'

export const detail = ({ navigation, route}) =>{
    console.log(route.params.card.name);
    checkRarity(route.params.card);
    return(
        <View>
            <CardViewWithImage
            width={300}
            source={route.params.card.images.small}
            content={ 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. At aut distinctio!' }
            title={ route.params.card.name }
            imageWidth={ '100%' }
            imageHeight={ 500 }
            roundedImage={ false }
          />
        </View>
    )
}

const checkRarity = (item) => {
    console.log(item);
}

detail.prototype ={
    card: propTypes.func
}
